import React from 'react';
import './App.css';

import Nav from './allComponents/nav.component.js';

class App extends React.Component {

  render(){
    var nav1 = [
      [{id:1}, {add: '/'}, {title:'Home'}],
      [{id:2}, {add:'/micros/'}, {title:'Microgreens'}],
      [{id:3}, {add:'/natives/'}, {title:'Native Plants'}],
      [{id:4}, {add:'/team/'}, {title:'The Team'}]
    ];

    return (
      <div className="App">
        <header className="App-header">

          <Nav value={nav1}/>

          <p>
              This will soon be EUG
          </p>
          <a
            className="App-link"
            href="http://evogrows.com"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn about EUG
          </a>
        </header>
      </div>
    );
  }
}

export default App;
